'''Logs''', also called '''normal logs''', are obtained from [[woodcutting|cutting]] [[Regular tree|regular]], [[evergreen]], [[Jungle tree|jungle]], [[Dying tree|dying]] and [[dead tree]]s. Players can burn these logs using the [[Firemaking]] [[skill]]. Cutting the logs gives 25 [[Woodcutting]] [[experience]], and burning them gives 40 Firemaking experience. These logs have no requirement to be cut or burned.

[[Members]] training [[Construction]] can bring logs to a [[sawmill]] to make [[planks]] at a cost of 100 [[coins]] each. Alternatively, the [[Lunar spell]] [[Plank Make]] can allow players to convert them to planks at a lower cost, but at the expense of [[runes]].

While wearing [[Kandarin headgear 1]] or higher, normal trees anywhere give double logs when chopped down but no additional experience is provided.

Members can also combine logs with fire lighters to create various coloured logs. The table below shows what firelighters can be combined with regular logs. The logs can be burned for 50xp each.

