Four normal logs respawn on [[Lumbridge Castle]]'s roof, in a house in [[Draynor Village]], in the [[Wizards' Tower]], and in a house in [[Rimmington]].

[[Members]] can also [[fletching|fletch]] these logs into [[bow]]s and [[arrow shaft]]s. It is currently the only log which can be used with [[gnomish firelighters]], which are obtained as rewards from [[Treasure Trails]]. These firelighters produce fire in one of five predetermined colours: red, blue, green, purple, or white, and also give slightly more Firemaking experience than lighting the logs normally.

Normal logs are also used to travel to [[Entrana]] or [[Taverley]] using the [[Balloon Transport System]] after completing the [[Enlightened Journey]] quest (they are also required during the quest).

