==Firemaking==
{{Main|Firemaking}}

A player only needs level 1 [[Firemaking]] and a [[tinderbox]] to turn a normal tree's [[logs]] into a [[fire]], granting 40 [[experience]].

The [[infernal axe]] provides a 1/3 chance of burning any log received when cutting trees. The player gains 20 Firemaking experience when cutting trees, half the experience gained from burning the log normally. If the Kandarin headgear 1 or above is worn in conjunction with the infernal axe, only one log is burned when a tree section is cut.

==Construction==
{{Main|Construction}}

Logs may be turned into [[plank]]s at a [[Sawmill]] for use in [[Construction]] for 100 [[coins]] each.
Alternatively, the Lunar spell Plank Make can allow players to convert the logs to planks at a lower cost, but at the expense of runes. 

==Fletching==
{{Main|Fletching}}

[[Logs]] from normal trees can be cut into [[arrow shafts]] at level 1 [[Fletching]] (granting 5 Fletching [[experience]]), [[shortbow]]s at level 5 (granting 5 XP for unstrung and another 5 experience for stringing), [[longbow]]s at level 10 (granting 10 experience for unstrung and another 10 experience for stringing), and [[crossbow stock]]s at level 9 (granting 6 experience).

